export default function Pagination({ dogsPerPage, allDogs, pagination }) {
  const pageNumbers = [];

  for (let i = 1; i <= Math.ceil(allDogs / dogsPerPage); i++) {
    pageNumbers.push(i);
  }
  return (
    <nav>
      <ul>
        {pageNumbers &&
          pageNumbers.map((number) => (
            <li key={number}>
              <div onClick={() => pagination(number)}>{number}</div>
            </li>
          ))}
      </ul>
    </nav>
  );
}
